import React, { useState, useEffect } from "react";
import "./pagina.css";
import "./modal.css";

const Panel = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:7777/get/GetZapatos")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
      })
      .catch((error) => {
        console.error("Error al obtener los datos:", error);
      });
  }, []);

  return (
    <div className="app">
      <div>
        <h1 className="pagina">Starbucks</h1>
        <p className="paginas">Aqu√≠ puedes visualizar las bebidas</p>
      </div>
      <div className="tabla-container">
        <table className="tabla">
          <thead>
            <tr></tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item._id.$oid} className="rectangulo" style={{ cursor: "pointer" }}>
                <td colSpan={1}>
                  <div className="informacion">
                    <div className="info2">{item.precio}</div>
                    <div className="info2">{item.talla}</div>
                    <div className="informacion">
                      <div className="image-container">
                        <img src={item.imagen} alt={item.marca} className="product-image" />
                      </div>
                      <div className="a">
                        <div className="a">{item.marca}</div>
                        <div className="a1">{`Color: ${item.color}`}</div>
                      </div>
                    </div>
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Panel;
